import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div className='expense-item'>
      <div> Date</div>
      <div className='expense-item'__description>
        <h2>Title</h2>
        <div className='expense-item'> Amount</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
